.cursors div {
 position: absolute;
 top: 300px;
 left: 300px;
 width:30px;
 height: 30px;
 background-color:rgba(202,207,199, 0.1);
 border-radius: 50%;
 z-index:10000;
 pointer-events: none;
 transform: translate(-50%, -50%);
  &:first-child::before {
    content:url(../img/cursor.svg);
    margin-left:10px;
    top:10px;
    border-bottom:0;
    position: absolute;
  }
  @include mq(mid) {
    display:none;
  }
}

.cursors div.footer {
  &:first-child::before {
    content:url(../img/cursor-white.svg);
    margin-left:10px;
    top:10px;
    border-bottom:0;
    position: absolute;
  }
}

.fade-out {
  background-color: transparent;
  transition: all .5s ease-in-out;
}

.fade-in {
  opacity: 1;
}

.wrapper {
  transform: translate3d(0px, -40px, 0px);
  transition: $default-transition;
    &.cookies {
      transform: translate3d(0px, 25px, 0px);
      @include mq(small) {
        transform: translate3d(0px, 55px, 0px);
      }
  }
}

a {
  text-decoration: none;
  font-family: $sans;
  cursor: none;
}

h1 {
  @include font-size($h1-font-sizes);
  font-family: $sans;
}

p, ul, ol, a {
  @include font-size($p-font-sizes);
}

p {
  font-family: $serif;
}

section {
  padding: 0 163px;
    @include mq(mid) {
      padding: 0 53px;
    }
      @include mq(small) {
      padding: 0 25px;
    }
  }

#index main section {
    h2 {
      color:var(--clr-umber-300);
      font-family: $sans;
      @include font-size($p-font-sizes);
    }
    a {
      @include hover-line-revers;
      position:relative;
      font-family: $sans;
      @include font-size($p-font-sizes);
      color:var(--clr-green-500);
      &::after {
      content:url(../img/green-arrow.svg);
      margin-left:10px;
      top:10px;
      border-bottom:0;
      position: absolute;
      }
      &:hover{
        color:var(--clr-umber-300);
      }
    }
  .content__paragraph {
      font-family: $serif;
      line-height: $line-height-headings;
      padding: $line-height-base 0 $line-height-base *2 0 ;
      @include font-size($p-header-font-sizes);
      @include mq(small){
        padding: $line-height-base 0 $line-height-base  0;
        @include font-size($intro-font-sizes);
      }

  }
  .links {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
    min-width: 250px;
    a {
      margin:$line-height-base 45px 3 45px;
    }
  }

}



.intro,
.podcast-main,
.clients {
max-width: 1100px;
margin: 0 auto;
height:100%;
display: grid;
grid-gap: 40px;
grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
place-items: center;
