    display: none;
  }
}

#consent-popup {
  position:fixed;
  text-align: center;
  top:0;
  left:0;
  right:0;
  padding: 1.5rem;
  opacity:1;
  transition: opacity 2s ease;
  background-color:var(--clr-umber-300);
  color: var(--clr-rose-100);
  z-index: 2;
    a {
      color: var(--clr-rose-100);
      border-bottom: 1px solid var(--clr-rose-100);
      font-size: 16px;
    }
    p {
      font-size: 16px;
      font-family: $sans;
    }
    .close {
      position: relative;
      right: 0px;
      top: 4px;
      padding: 8px;
      width: 22px;
      height: 32px;
      opacity: 0.8;
      border-bottom: none;
    }
    .close:hover {
      opacity: 1;
    }
    .close:before, .close:after {
      position: absolute;
      left: 15px;
      content: ' ';
      height: 16px;
      width: 1.5px;
      background-color:var(--clr-rose-100);
    }
    .close:before {
      transform: rotate(45deg);
    }
    .close:after {
      transform: rotate(-45deg);
    }    
    &.hidden {
      opacity: 0;
      transition: all 700ms ease 0s;
      transform: translate3d(0px, -156px, 0px);
    }  
    @include mq(small) {
      p, a {
        font-size: 15px;
      }
      .close {
      padding: 8px;
      position: absolute;
      }
    }
}


